import React from 'react';

const SignUpPage = () => {
    return (
        <div>
            <form action="">
                <h1>Create New Xpense Account</h1>
                <table>
                    <tr><label htmlFor="">First Name</label></tr>
                    <tr><input type="text" /></tr>
                    <tr><label htmlFor="">Other Name</label></tr>
                    <tr><input type="text" /></tr>
                    <tr><label htmlFor="">Email</label></tr>
                    <tr><input type="text" /></tr>
                    <tr><label htmlFor="">Password</label></tr>
                    <tr><input type="password" /></tr>
                    <tr><label htmlFor="">Repeat Password</label></tr>
                    <tr><input type="repeatPassword" /></tr>
                    <tr><label htmlFor="maximum expense"></label></tr>
                    <tr><input type="number" /></tr>
                </table>
            </form>
        </div>
    );
};

export default SignUpPage;
